package gtools

import (
	"os"
	"testing"
	"time"
)

func ErrExit(t *testing.T, err error) {
	if err != nil {
		t.Error(err)
		os.Exit(-1)
	}
}

func TestFileTool(t *testing.T) {
	currentPath, err := GetCurrentPath()
	ErrExit(t, err)
	t.Log(currentPath)

	if PathIsExist("temp/") {
		t.Log("temp folder ok")
	} else {
		ErrExit(t, MkdirAll("temp/"))
	}

	base64Data := ""
	ErrExit(t, Base64ToFile(base64Data, "temp/test.png"))

	ErrExit(t, CreateFile(time.Now().String(), "temp/test.txt"))

	base64Str, err := FileToBase64("temp/test.png")
	ErrExit(t, err)
	t.Log(base64Str)
}
